import React, { Component } from 'react';
import { bindActionsCreators } from 'redux';

import * as todoActios from './actions/todos';

class TodoList extends Component {
    render() {
        return (
            <div>  
                <ul>
                  <li>Item do todo</li>
                </ul>   

             <input type='text' /> 
             <button>Novo Todo</button>
             </div>
        );
    }
}

export default TodoList;
